  return "Pad 4: "..value
end

-- Dissect: Pad 4
eurex_derivatives_eti_t7_v7_1.pad_4.dissect = function(buffer, offset, packet, parent)
  local length = eurex_derivatives_eti_t7_v7_1.pad_4.size
  local range = buffer(offset, length)
  local value = range:bytes():tohex(false, " ")
  local display = eurex_derivatives_eti_t7_v7_1.pad_4.display(value, buffer, offset, packet, parent)

  parent:add(omi_eurex_derivatives_eti_t7_v7_1.fields.pad_4, range, value, display)

  return offset + length, value
end

