-- Sending Time
eurex_derivatives_eti_t7_v7_1.sending_time = {}

-- Size: Sending Time
eurex_derivatives_eti_t7_v7_1.sending_time.size = 8

-- Display: Sending Time
eurex_derivatives_eti_t7_v7_1.sending_time.display = function(value)
  -- Check null sentinel value
  if value == UInt64(0xFFFFFFFF, 0xFFFFFFFF) then
    return "Sending Time: No Value"
  end
  -- Parse unix timestamp
  local seconds = math.floor(value:tonumber()/1000000000)
  local nanoseconds = value:tonumber()%1000000000

  return "Sending Time: "..os.date("%x %H:%M:%S.", seconds)..string.format("%09d", nanoseconds)
end

-- Dissect: Sending Time
eurex_derivatives_eti_t7_v7_1.sending_time.dissect = function(buffer, offset, packet, parent)
  local length = eurex_derivatives_eti_t7_v7_1.sending_time.size
  local range = buffer(offset, length)
  local value = range:le_uint64()
  local display = eurex_derivatives_eti_t7_v7_1.sending_time.display(value, buffer, offset, packet, parent)

  parent:add(omi_eurex_derivatives_eti_t7_v7_1.fields.sending_time, range, value, display)

  return offset + length, value
end

