-- Calculate size of: Fills Grp Comp
eurex_derivatives_eti_t7_v7_1.fills_grp_comp.size = function(buffer, offset)
  local index = 0

  index = index + eurex_derivatives_eti_t7_v7_1.fill_px.size

  index = index + eurex_derivatives_eti_t7_v7_1.fill_qty.size

  index = index + eurex_derivatives_eti_t7_v7_1.fill_match_id.size

  index = index + eurex_derivatives_eti_t7_v7_1.fill_exec_id.size

  index = index + eurex_derivatives_eti_t7_v7_1.fill_liquidity_ind.size

  index = index + eurex_derivatives_eti_t7_v7_1.pad_7.size

  return index
end

-- Display: Fills Grp Comp
eurex_derivatives_eti_t7_v7_1.fills_grp_comp.display = function(packet, parent, length)
  return ""
end

-- Dissect Fields: Fills Grp Comp
eurex_derivatives_eti_t7_v7_1.fills_grp_comp.fields = function(buffer, offset, packet, parent, fills_grp_comp_index)
  local index = offset

  -- Implicit Fills Grp Comp Index
  if fills_grp_comp_index ~= nil then
    local iteration = parent:add(omi_eurex_derivatives_eti_t7_v7_1.fields.fills_grp_comp_index, fills_grp_comp_index)
    iteration:set_generated()
  end

  -- Fill Px: 8 Byte Unsigned Fixed Width Integer Nullable
  index, fill_px = eurex_derivatives_eti_t7_v7_1.fill_px.dissect(buffer, index, packet, parent)

  -- Fill Qty: 8 Byte Unsigned Fixed Width Integer Nullable
  index, fill_qty = eurex_derivatives_eti_t7_v7_1.fill_qty.dissect(buffer, index, packet, parent)

  -- Fill Match Id: 4 Byte Unsigned Fixed Width Integer Nullable
  index, fill_match_id = eurex_derivatives_eti_t7_v7_1.fill_match_id.dissect(buffer, index, packet, parent)

  -- Fill Exec Id: 4 Byte Signed Fixed Width Integer Nullable
  index, fill_exec_id = eurex_derivatives_eti_t7_v7_1.fill_exec_id.dissect(buffer, index, packet, parent)

  -- Fill Liquidity Ind: 1 Byte Unsigned Fixed Width Integer Enum with 7 values
  index, fill_liquidity_ind = eurex_derivatives_eti_t7_v7_1.fill_liquidity_ind.dissect(buffer, index, packet, parent)

  -- Pad 7: 7 Byte
  index, pad_7 = eurex_derivatives_eti_t7_v7_1.pad_7.dissect(buffer, index, packet, parent)

  return index
end

-- Dissect: Fills Grp Comp
eurex_derivatives_eti_t7_v7_1.fills_grp_comp.dissect = function(buffer, offset, packet, parent, fills_grp_comp_index)
  if show.fills_grp_comp then
    -- Optionally add element to protocol tree
    parent = parent:add(omi_eurex_derivatives_eti_t7_v7_1.fields.fills_grp_comp, buffer(offset, 0))
    local index = eurex_derivatives_eti_t7_v7_1.fills_grp_comp.fields(buffer, offset, packet, parent, fills_grp_comp_index)
    local length = index - offset
    parent:set_len(length)
    local display = eurex_derivatives_eti_t7_v7_1.fills_grp_comp.display(packet, parent, length)
    parent:append_text(display)

    return index, parent
  else
    -- Skip element, add fields directly
    return eurex_derivatives_eti_t7_v7_1.fills_grp_comp.fields(buffer, offset, packet, parent, fills_grp_comp_index)
  end
end

